import { createFileRoute } from '@tanstack/react-router'

export const startTime = Date.now()

export function healthHandler() {
  return new Response(
    JSON.stringify({
      status: 'ok',
      timestamp: new Date().toISOString(),
      uptime_seconds: Math.floor((Date.now() - startTime) / 1000),
    }),
    {
      status: 200,
      headers: {
        'Content-Type': 'application/json',
      },
    },
  )
}

export const Route = createFileRoute('/api/health')({
  server: {
    handlers: {
      GET: () => healthHandler(),
    },
  },
})

import { describe, it, expect } from 'vitest'
import { healthHandler, startTime } from './health'

describe('GET /api/health', () => {
  it('returns 200 status code', () => {
    const response = healthHandler()
    expect(response.status).toBe(200)
  })

  it('returns Content-Type application/json', () => {
    const response = healthHandler()
    expect(response.headers.get('Content-Type')).toBe('application/json')
  })

  it('returns { status: "ok", timestamp: <ISO string> }', async () => {
    const response = healthHandler()
    const body = await response.json()

    expect(body).toHaveProperty('status', 'ok')
    expect(body).toHaveProperty('timestamp')
    // Validate ISO 8601 format
    expect(new Date(body.timestamp).toISOString()).toBe(body.timestamp)
  })

  it('returns a current timestamp', async () => {
    const before = new Date().toISOString()
    const response = healthHandler()
    const body = await response.json()
    const after = new Date().toISOString()

    expect(body.timestamp >= before).toBe(true)
    expect(body.timestamp <= after).toBe(true)
  })

  it('includes uptime_seconds as a non-negative integer', async () => {
    const response = healthHandler()
    const body = await response.json()

    expect(body).toHaveProperty('uptime_seconds')
    expect(typeof body.uptime_seconds).toBe('number')
    expect(Number.isInteger(body.uptime_seconds)).toBe(true)
    expect(body.uptime_seconds).toBeGreaterThanOrEqual(0)
  })

  it('computes uptime_seconds from module-level startTime', async () => {
    const expectedUptime = Math.floor((Date.now() - startTime) / 1000)
    const response = healthHandler()
    const body = await response.json()

    // Allow 1 second tolerance for execution time
    expect(body.uptime_seconds).toBeGreaterThanOrEqual(expectedUptime)
    expect(body.uptime_seconds).toBeLessThanOrEqual(expectedUptime + 1)
  })
})
